import React from "react";
import Paginator from "./Paginator";
import User from "./User";

const Users =(props)=>{
        return (
            <div>
                <Paginator currentPage={props.currentPage} pages={props.pages} onPageChange={props.onPageChange}/>
                <br/>
                {props.usersPage.users.map(u => (<User u={u} {...props}/>))}
            </div>
        )}
export default Users;
